import React from "react";

function ProductItem({ product }) {
  return (
    <div>
      <img src={product.image.url} alt="pic" />

      <div>
        <h2>{product.title}</h2>
        <span>${product.price}</span>
        <p>{product.description}</p>
      </div>
    </div>
  );
}

export default ProductItem;
